I'll just come out and say it: in other interpreted languages, it's really simple to do things. Let's go with the classic, printing "Hello World!". Python: thing = "Hello World!"
print(thing) R: thing = "Hello World!"
print(thing) And comparatively in Rust: fn main(){ let thing="Hello World!"; println!("{}", thing);
} playground Why is it so much longer in Rust? With great power comes having to be specific! Let's break it down based on what we learned so far. We're building a binary, which is why we have the main function, fn main(){}. Inside the main function, we create a variable thing that stores "Hello World!" We put the thing variable into println!, where "{}" is just our variable, and the second input is the actual variable to be printed. We could also print something more fun like: Our variable contains: Hello World! by typing: println!("Our variable contains: {}", thing);

